import React from 'react';
import MenuItem from '../menu-item/menu-item.component';
class Menu extends React.Component 
{
    constructor()
    {
        super();
        this.state = 
            {
            section: [
            {
                title: "PLAY",
                link: ""
            },
            {
                title: "SETTINGS",
                link: ""
            },
            {
                title: "ACCOUNT",
                link: ""
            }
        ]
        }
    }
    render() {
        return (
            <div className='menu'>
                {this.state.section.map(({id, ...otherSectionProps }) => (
                    <MenuItem key={id} {...otherSectionProps} />
                ))}
            </div>
        );
    }
}

export default Menu;
